import Input from '../form/input'

function UpdateForm({
    formName, 
    handleSubmit,
    handleChange
}){
    return (
        <div>
            <p>{formName}</p>
            <form onSubmit={handleSubmit}>
                 <Input text={textIn1}/>
                 <Input text={textIn2}/>
                 <Input text={textIn3}/>
                 <Input text={textIn4}/>
            </form>
        </div>
    )
}

export default UpdateForm
